import React from "react";
import { useState } from "react";
import '../style.css';
import * as color from '../colors.js';
function Dashboard(){
    return(
        <>
        <div>
            <div>
                <h3 style={{marginTop:"0",color:color.contrast}}>DASHBOARD</h3>
            </div>
        </div>
        </>
    );
    
}
export default Dashboard;
